script: |
  super -f text -I q894.spq | sort > q894.out

inputs:
  - name: q894.spq
    data: |
      SELECT ALL col2 * col0 - + col2 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - col2 * col2 - col0 BETWEEN col0 * col2 + col2 AND NULL;
  - name: tab1

outputs:
  - name: q894.out
    data: |
      108
      3591
      7584
